import React, { useEffect, useState } from "react";

const Home = () => {
    const [showData, setData] = useState([])

    useEffect(() => {
        const getData = async() => {
            const response = await fetch('http://localhost:3000/data-home')
            const data = await response.json()
            
            setData(data)
        }
        getData()
    }, [])

    return(
        <>
            <div>
                
            </div>
            <p>Welcome</p>
        </>
    )
}

export default Home
